import React, { useState } from 'react';

function Provincias() {
    const [provin, setProvin] = React.useState([]);

    React.useEffect(()=> {
        // const url = 'https://apis.datos.gob.ar/georef/api/provincias?nombre=cordoba';
        const url = 'https://pokeapi.co/api/v2/pokemon-form/1/'; 
        fetch(url).then((response)=>{
            if (response.ok){
                return response.json();
            }else {
                throw response;
            }
        })
        .then((data) => setProvin(data.results))
        .catch((error)=> console.log('Error, provincia no encontrada'));
    }, [])
    return(
        <div>
            {provin?.map(provincia => {
                return(
                    <div>
                    <h5>{provincia.name}</h5>
                    {/* <img src={provincia.front_shiny} /> */}
                    </div>
                );
            })}
        </div>
    )
}

export default Provincias;
